		public static int GeodeOpening(long seed, out bool hasPrismatic, bool includePrismatic = false, bool printOpenings = false, int limit = 150)
		{
			hasPrismatic = false;
			HashSet<string> allItems = new HashSet<string>() { "(O)82", "(O)84", "(O)541", "(O)544", "(O)545", "(O)546", "(O)550", "(O)551", "(O)559", "(O)560", "(O)561", "(O)564", "(O)567", "(O)572", "(O)573", "(O)577", "(O)539", "(O)540", "(O)543", "(O)547", "(O)553", "(O)554", "(O)562", "(O)563", "(O)565", "(O)570", "(O)575", "(O)578", "(O)122", "(O)123", "(O)538", "(O)542", "(O)548", "(O)549", "(O)552", "(O)555", "(O)556", "(O)557", "(O)558", "(O)566", "(O)568", "(O)569", "(O)571", "(O)574", "(O)576", "(O)121" };
			HashSet<string> items = new HashSet<string>() { "(O)82", "(O)84", "(O)541", "(O)544", "(O)545", "(O)546", "(O)550", "(O)551", "(O)559", "(O)560", "(O)561", "(O)564", "(O)567", "(O)572", "(O)573", "(O)577", "(O)539", "(O)540", "(O)543", "(O)547", "(O)553", "(O)554", "(O)562", "(O)563", "(O)565", "(O)570", "(O)575", "(O)578", "(O)122", "(O)123", "(O)538", "(O)542", "(O)548", "(O)549", "(O)552", "(O)555", "(O)556", "(O)557", "(O)558", "(O)566", "(O)568", "(O)569", "(O)571", "(O)574", "(O)576", "(O)121" }; ;

			if (includePrismatic)
			{
				allItems.Add("(O)74");
				items.Add("(O)74");
			}

			int geode = 0;
			int count = -1;

			List<string> omniItems = new List<string>();
			List<string> geodeItems = new List<string>();

			Dictionary<string,int> itemCount = new Dictionary<string,int>();
			Dictionary<int, string> whatToOpen = new Dictionary<int, string>();
			Dictionary<string, int> whatHasBeenOpened = new Dictionary<string, int>();
			List<(string,string)> tupleResults = new List<(string,string)> ();

			int index = -1;
			while (geode < limit)
			{
				// Get geode contents
				geode++;
				string geodeItem = Mines.GetGeodeContents1_6(seed, geode, Geode.Geode, 25).Item1;
				string omniItem = Mines.GetGeodeContents1_6(seed, geode, Geode.OmniGeode, 25).Item1;

				if (omniItem == "(O)74")
				{
					hasPrismatic = true;
				}

				// Save off contents in list
				omniItems.Add(omniItem);
				geodeItems.Add(geodeItem);

				// Check if result is the exact same as one already found, and assign
				(string, string) result = (geodeItem, omniItem);
				index = tupleResults.IndexOf(result);
				tupleResults.Add(result);

				// Not donatable, don't care
				if (!allItems.Contains(omniItem))
				{
					continue;
				}

				// Carry on with duplication check
				if (index != -1)
				{
					// Make sure we haven't assigned the item already
					if (!whatHasBeenOpened.ContainsKey(geodeItem))
					{
						whatToOpen[index] = "Geode";
						whatHasBeenOpened[geodeItem] = index;
						itemCount.Remove(geodeItem);
					}
					if (!whatHasBeenOpened.ContainsKey(omniItem))
					{
						whatToOpen[geode-1] = "Omni";
						whatHasBeenOpened[omniItem] = geode-1;
						itemCount.Remove(omniItem);
					}
				}
				else 
				{

					// Increment total found
					if (!whatHasBeenOpened.ContainsKey(omniItem))
					{
						count = 0;
						itemCount.TryGetValue(omniItem, out count);

						count++;
						itemCount[omniItem] = count;
					}

					if (!whatHasBeenOpened.ContainsKey(geodeItem))
					{
						count = 0;
						itemCount.TryGetValue(geodeItem, out count);

						count++;
						itemCount[geodeItem] = count;
					}

					// Remove from items if appropriate
					if (items.Contains(omniItem))
					{
						items.Remove(omniItem);
					}

					if (items.Contains(geodeItem))
					{
						items.Remove(geodeItem);
					} 
				}

				// All items have been found, time to see if we can get everything out
				if (items.Count == 0)
				{
					bool madeChange = true;
					while (madeChange)
					{
						madeChange = false;
						string toRemove = "";
						string otherItem = "";
						foreach (var entry in itemCount)
						{
							// If only one entry in collection, then assign it
							if (entry.Value == 1)
							{
								index = omniItems.IndexOf(entry.Key);
								if (index >= 0)
								{
									toRemove = entry.Key;
									otherItem = geodeItems[index];
									whatToOpen[index] = "Omni";
									whatHasBeenOpened[entry.Key] = index;
								}
								else
								{
									index = geodeItems.IndexOf(entry.Key);
									if (index >= 0)
									{
										toRemove = entry.Key;
										otherItem = omniItems[index];
										whatToOpen[index] = "Geode";
										whatHasBeenOpened[entry.Key] = index;
									}
									else
									{
										// Something went wrong
										Console.WriteLine("Something went wrong");
										throw new Exception();
									}
								}

								break;
							}
						}
						// Have assigned a geode.  Decrease counts
						if (toRemove != "")
						{

							if (itemCount.ContainsKey(otherItem))
							{
								count = itemCount[otherItem];
								if (count == 1)
								{
									// Just removed the last of this item. Gotta now keep looking at geodes
									items.Add(otherItem);
									continue;
								}
								itemCount[otherItem] = count - 1;
							}
							itemCount.Remove(toRemove);
							madeChange = true;
							continue;
						}



						// Iterate current results, looking for items that has one side already assigned
						for( int i = 0; i < geodeItems.Count; i++ )
						{
							geodeItem = geodeItems[i];
							omniItem = omniItems[i];

							if (whatHasBeenOpened.ContainsKey(geodeItem))
							{
								if (!whatHasBeenOpened.ContainsKey(omniItem))
								{
									whatToOpen[i] = "Omni";
									whatHasBeenOpened[omniItem] = i;
									itemCount.Remove(omniItem);
									madeChange = true;
								}
							}else if (whatHasBeenOpened.ContainsKey(omniItem))
							{
								whatToOpen[i] = "Geode";
								whatHasBeenOpened[geodeItem] = i;
								itemCount.Remove(geodeItem);
								madeChange = true;
							}
						}

						// Success
						if (itemCount.Count == 0)
						{
							if (printOpenings)
							{
								for( int i = 1; i <= geode; i++ )
								{
									string line = "";
									if (whatToOpen.ContainsKey(i))
									{
										line = whatToOpen[i];
									}
									Console.WriteLine(line);
								}
							}
							return geode;
						}

						
					}

					// Keep looking at geodes
				}

			}
			return -1;
		}
