			public static double Search(long start, long end, int blockSize, out List<long> validSeeds)
        {
            Stopwatch stopwatch = Stopwatch.StartNew();
            var bag = new ConcurrentBag<long>();
            var partioner = Partitioner.Create(start, end, blockSize);
            Parallel.ForEach(partioner, (range, loopState) =>
            {
                for (long seed = (long)range.Item1; seed < range.Item2; seed++)
                {
                    if (!CheckSeed(seed))
                    {
                        continue;
                    }

                    bag.Add(seed);
                    FileStream fs = null;
                    int i = 0;
                    while (fs == null)
                    {
                        try
                        {
                            fs = new FileStream($"KrobusDynamicL{i}.txt", FileMode.Append);
                        }
                        catch
                        {
                            i++;
                        }
                    }
                    StreamWriter stream = new StreamWriter(fs);
                    stream.Write($"{seed},");
                    Console.WriteLine(seed);
                    stream.Close();
                }
            });
            double seconds = stopwatch.Elapsed.TotalSeconds;
            Console.WriteLine($"Found: {bag.Count} sols in {seconds.ToString("F2")} s");
            validSeeds = bag.ToList();
            validSeeds.Sort();
            return seconds;
        }

       

